INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 119701, 0, 0, 4, 0, "シェフィ", 0, 0, 119701, 3, 0, 0, 4, "しぇふぃ", "", 0, "2030/12/31 15:00:00", "2022/01/31 12:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.17, 450, 302, 0, 14, 119901, 0, 119901, 1, 1, "ミヤコ（クリスマス）", 0, 0, 119901, 3, 119901, 0, 1, "みやこ", "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 0, "2025/12/31 11:59:59", "2025/12/21 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.375, 450, 190, 0, 6, 120001, 0, 120001, 5, 1, "シズル（ノワール）", 0, 0, 120001, 3, 120001, 0, 5, "しずる", "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 0, "2025/03/15 14:59:59", "2025/03/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 120101, 0, 0, 7, 0, "イオ（ノワール）", 0, 0, 120101, 3, 0, 0, 7, "いお", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
