INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 465, 180801, 0, 120601, 0, 0, 0, 1, "キョウカ（リトルリリカル）", 1, 0, 120601, 3, 0, 0, 0, "きょうか", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 283, 0, 1, 120701, 0, 120701, 4, 1, "シェフィ（ニューイヤー）", 0, 0, 120701, 3, 120701, 0, 22, "しぇふぃ", "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 0, "2025/01/20 11:59:59", "2025/01/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.3, 450, 193, 0, 2, 120801, 0, 120801, 4, 1, "ルカ（ニューイヤー）", 0, 0, 120801, 1, 120801, 0, 22, "るか", "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 0, "2030/12/31 15:00:00", "2023/10/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.425, 450, 424, 0, 12, 120901, 0, 120901, 3, 1, "イリヤ（ニューイヤー）", 0, 0, 120901, 3, 120901, 0, 38, "いりや", "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 0, "2025/01/20 11:59:59", "2025/01/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.25, 450, 164, 0, 1, 121001, 0, 121001, 5, 1, "ペコリーヌ（オーバーロード）", 0, 0, 121001, 3, 121001, 0, 41, "ぺこりーぬ", "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 0, "2025/02/24 11:59:59", "2025/02/20 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.07, 450, 588, 0, 1, 121101, 0, 121101, 7, 1, "キャル（オーバーロード）", 0, 0, 121101, 3, 121101, 0, 42, "きゃる", "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 0, "2025/02/24 11:59:59", "2025/02/20 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.55, 450, 260, 0, 6, 121201, 0, 121201, 4, 1, "ラビリスタ（オーバーロード）", 0, 0, 121201, 1, 121201, 0, 40, "らびりすた", "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 0, "2030/12/31 15:00:00", "2023/11/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.9, 450, 731, 0, 3, 121301, 0, 121301, 3, 0, "クルミ（ステージ）", 0, 0, 121301, 3, 121301, 0, 3, "くるみ", "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, "2030/12/31 15:00:00", "2022/03/03 19:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.27, 450, 742, 0, 15, 121401, 0, 121401, 7, 0, "ミサキ（ステージ）", 0, 0, 121401, 3, 121401, 0, 7, "みさき", "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, "2030/12/31 15:00:00", "2022/03/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.0, 450, 590, 0, 12, 121501, 0, 121501, 6, 1, "アユミ（怪盗）", 0, 0, 121501, 3, 121501, 0, 6, "あゆみ", "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 0, "2025/04/30 11:59:59", "2025/04/26 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.425, 450, 292, 0, 17, 121601, 0, 121601, 3, 0, "イノリ（怪盗）", 0, 0, 121601, 3, 121601, 0, 3, "いのり", "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, "2030/12/31 15:00:00", "2022/04/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 421, 180901, 0, 121701, 0, 0, 0, 1, "アキノ（アキノ＆サレン）", 1, 0, 121701, 3, 0, 0, 0, "あきの", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 421, 180901, 0, 121801, 0, 0, 0, 1, "サレン（アキノ＆サレン）", 1, 0, 121801, 3, 0, 0, 0, "されん", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.125, 450, 293, 0, 12, 121901, 0, 121901, 5, 0, "アンナ（パイレーツ）", 0, 0, 121901, 3, 121901, 0, 5, "あんな", "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 0, "2030/12/31 15:00:00", "2022/05/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.425, 450, 380, 0, 14, 122001, 0, 122001, 3, 0, "シノブ（パイレーツ）", 0, 0, 122001, 3, 122001, 0, 3, "しのぶ", "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 0, "2030/12/31 15:00:00", "2022/05/03 19:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.97, 450, 731, 0, 9, 122101, 0, 122101, 35, 1, "アオイ（キャンプ）", 0, 0, 122101, 1, 122101, 0, 35, "あおい", "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 0, "2030/12/31 15:00:00", "2024/04/18 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 419, 0, 8, 122201, 0, 122201, 4, 0, "ユカリ（キャンプ）", 0, 0, 122201, 3, 122201, 0, 4, "ゆかり", "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 0, "2030/12/31 15:00:00", "2022/05/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.425, 450, 564, 0, 0, 122301, 0, 122301, 43, 0, "ヴァンピィ", 0, 0, 122301, 3, 122301, 0, 43, "うぁんぴぃ", "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 0, "2030/12/31 15:00:00", "2022/06/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.42, 450, 264, 0, 8, 122401, 0, 122401, 1, 1, "ヒヨリ（サマー）", 0, 0, 122401, 1, 122401, 0, 1, "ひより", "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 0, "2030/12/31 15:00:00", "2024/06/17 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 250, 0, 0, 122501, 0, 122501, 4, 1, "レイ（サマー）", 0, 0, 122501, 3, 122501, 0, 4, "れい", "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 0, "2025/08/31 11:59:59", "2025/08/22 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.27, 450, 554, 0, 0, 122601, 0, 122601, 7, 0, "ユイ（サマー）", 0, 0, 122601, 3, 122601, 0, 7, "ゆい", "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 0, "2030/12/31 15:00:00", "2022/07/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 812, 0, 0, 122701, 0, 122701, 7, 0, "キョウカ（サマー）", 0, 0, 122701, 3, 122701, 0, 7, "きょうか", "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 0, "2030/12/31 15:00:00", "2022/08/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.295, 450, 237, 0, 0, 122801, 0, 122801, 1, 1, "ミソギ（サマー）", 0, 0, 122801, 1, 122801, 0, 1, "みそぎ", "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 0, "2030/12/31 15:00:00", "2024/07/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.25, 450, 361, 0, 0, 122901, 0, 122901, 5, 1, "ミミ（サマー）", 0, 0, 122901, 3, 122901, 0, 5, "みみ", "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 0, "2025/08/31 11:59:59", "2025/08/22 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.27, 450, 746, 0, 0, 123001, 0, 123001, 44, 1, "アメス", 0, 0, 123001, 3, 123001, 0, 44, "あめす", "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.795, 450, 793, 0, 0, 123101, 0, 123101, 7, 0, "マホ（エクスプローラー）", 0, 0, 123101, 3, 123101, 0, 7, "まほ", "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 0, "2030/12/31 15:00:00", "2022/09/03 19:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.425, 450, 256, 0, 0, 123201, 0, 123201, 3, 0, "アヤネ（エクスプローラー）", 0, 0, 123201, 3, 123201, 0, 3, "あやね", "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 0, "2030/12/31 15:00:00", "2022/09/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.62, 450, 350, 0, 0, 123301, 0, 123301, 1, 1, "ネア", 0, 0, 123301, 3, 123301, 0, 0, "ねあ", "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, "2025/09/30 11:59:59", "2025/09/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 123401, 0, 0, 5, 0, "ジュン（キャンプ）", 0, 0, 123401, 3, 0, 0, 5, "じゅん", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.34, 450, 583, 0, 0, 123501, 0, 123501, 6, 1, "リン（ハロウィン）", 0, 0, 123501, 1, 123501, 0, 6, "りん", "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 0, "2030/12/31 15:00:00", "2024/09/17 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 262, 0, 0, 123601, 0, 123601, 4, 1, "トモ（ハロウィン）", 0, 0, 123601, 3, 123601, 0, 4, "とも", "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 0, "2025/11/30 11:59:59", "2025/11/14 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.07, 450, 741, 0, 0, 123701, 0, 123701, 7, 0, "ナナカ（ハロウィン）", 0, 0, 123701, 3, 123701, 0, 21, "ななか", "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 0, "2030/12/31 15:00:00", "2022/10/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.295, 450, 238, 0, 0, 123801, 0, 123801, 1, 1, "クリスティーナ（ワイルド）", 0, 0, 123801, 3, 123801, 0, 1, "くりすてぃーな", "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.125, 450, 183, 0, 0, 123901, 0, 123901, 2, 0, "マツリ（ワイルド）", 0, 0, 123901, 3, 123901, 0, 2, "まつり", "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 0, "2030/12/31 15:00:00", "2022/11/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.07, 450, 438, 0, 0, 124001, 0, 124001, 7, 1, "アカリ（クリスマス）", 0, 0, 124001, 3, 124001, 0, 7, "あかり", "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 0, "2025/12/31 11:59:59", "2025/12/21 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 433, 0, 0, 124101, 0, 124101, 6, 1, "ヨリ（クリスマス）", 0, 0, 124101, 1, 124101, 0, 6, "より", "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 0, "2030/12/31 15:00:00", "2024/11/16 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.07, 450, 144, 0, 0, 124201, 0, 124201, 5, 0, "ジュン（クリスマス）", 0, 0, 124201, 3, 124201, 0, 5, "じゅん", "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 0, "2030/12/31 15:00:00", "2022/12/23 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 577, 181001, 0, 124301, 0, 0, 0, 1, "アン（アン＆グレア）", 1, 0, 124301, 3, 0, 0, 0, "あん", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 577, 181001, 0, 124401, 0, 0, 0, 1, "グレア（アン＆グレア）", 1, 0, 124401, 3, 0, 0, 0, "ぐれあ", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.07, 450, 707, 0, 0, 124501, 0, 124501, 7, 1, "ホマレ（ニューイヤー）", 0, 0, 124501, 3, 124501, 0, 21, "ほまれ", "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 0, "2025/01/20 11:59:59", "2025/01/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.44, 450, 698, 0, 0, 124601, 0, 124601, 7, 1, "ミサト（ニューイヤー）", 0, 0, 124601, 3, 124601, 0, 21, "みさと", "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 0, "2025/01/20 11:59:59", "2025/01/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.24, 450, 590, 0, 0, 124701, 0, 124701, 7, 1, "ミツキ（ニューイヤー）", 0, 0, 124701, 1, 124701, 0, 46, "みつき", "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 0, "2030/12/31 15:00:00", "2024/12/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.14, 450, 423, 0, 0, 124801, 0, 124801, 4, 1, "ノゾミ（リベレイター）", 0, 0, 124801, 3, 124801, 0, 0, "のぞみ", "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, "2025/02/24 11:59:59", "2025/02/20 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 170, 0, 0, 124901, 0, 124901, 1, 1, "カヤ（リベレイター）", 0, 0, 124901, 1, 124901, 0, 0, "かや", "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, "2030/12/31 15:00:00", "2025/01/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 221, 0, 0, 125001, 0, 125001, 5, 1, "ムイミ（リベレイター）", 0, 0, 125001, 3, 125001, 0, 0, "むいみ", "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, "2025/02/24 11:59:59", "2025/02/20 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.24, 450, 825, 0, 0, 125101, 0, 125101, 8, 0, "タマキ（カフェ）", 0, 0, 125101, 3, 125101, 0, 47, "たまき", "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 0, "2030/12/31 15:00:00", "2023/03/03 19:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 463, 0, 0, 125201, 0, 125201, 4, 0, "モニカ（カフェ）", 0, 0, 125201, 3, 125201, 0, 4, "もにか", "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 0, "2030/12/31 15:00:00", "2023/03/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.07, 450, 752, 0, 0, 125301, 0, 125301, 6, 1, "コッコロ（レンジャー）", 0, 0, 125301, 3, 125301, 0, 6, "こっころ", "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 0, "2025/04/30 11:59:59", "2025/04/26 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 710, 0, 0, 125401, 0, 125401, 8, 0, "シオリ（レンジャー）", 0, 0, 125401, 3, 125401, 0, 8, "しおり", "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 0, "2030/12/31 15:00:00", "2023/04/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 443, 0, 0, 125501, 0, 125501, 7, 1, "ジータ（ウォーロック）", 0, 0, 125501, 3, 125501, 0, 50, "じーた", "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 0, "2025/05/31 11:59:59", "2025/05/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 267, 0, 0, 125601, 0, 125601, 51, 1, "ビカラ", 0, 0, 125601, 3, 125601, 0, 0, "びから", "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, "2025/05/31 11:59:59", "2025/05/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.24, 450, 579, 0, 0, 125701, 0, 125701, 7, 1, "カリン（アルケミスト）", 0, 0, 125701, 1, 125701, 0, 9, "かりん", "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 0, "2030/12/31 15:00:00", "2025/04/16 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 464, 0, 0, 125801, 0, 125801, 3, 0, "リリ（フォールン）", 0, 0, 125801, 3, 125801, 0, 0, "りり", "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, "2030/12/31 15:00:00", "2023/04/17 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 125901, 0, 0, 1, 1, "カヤ（リベレイター）", 0, 0, 125901, 3, 0, 0, 1, "かや", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 406, 0, 0, 126001, 0, 126001, 0, 0, "クリア（フォールン）", 0, 0, 126001, 3, 126001, 0, 0, "くりあ", "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, "2030/12/31 15:00:00", "2023/10/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 480, 0, 0, 126101, 0, 126101, 44, 0, "プレシア（フォールン）", 0, 0, 126101, 3, 126101, 0, 53, "ぷれしあ", "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 0, "2030/12/31 15:00:00", "2023/11/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 568, 0, 0, 126201, 0, 126201, 3, 1, "イリヤ（儀装束）", 0, 0, 126201, 3, 126201, 0, 3, "いりや", "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 0, "2025/06/20 11:59:59", "2025/06/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.07, 450, 456, 0, 0, 126301, 0, 126301, 7, 0, "ユキ（儀装束）", 0, 0, 126301, 3, 126301, 0, 9, "ゆき", "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 0, "2030/12/31 15:00:00", "2023/06/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 373, 0, 0, 126401, 0, 126401, 1, 1, "クローチェ", 0, 0, 126401, 3, 126401, 0, 1, "くろーちぇ", "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 740, 0, 0, 126501, 0, 126501, 7, 1, "ライラエル", 0, 0, 126501, 3, 126501, 0, 0, "らいらえる", "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.04, 450, 650, 0, 0, 126601, 0, 126601, 7, 1, "ネネカ（サマー）", 0, 0, 126601, 3, 126601, 0, 7, "ねねか", "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 0, "2025/08/15 14:59:59", "2025/08/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 224, 0, 0, 126701, 0, 126701, 5, 1, "アキノ（サマー）", 0, 0, 126701, 1, 126701, 0, 5, "あきの", "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 0, "2030/12/31 15:00:00", "2025/06/17 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.97, 450, 159, 0, 0, 126801, 0, 126801, 5, 0, "ユカリ（サマー）", 0, 0, 126801, 3, 126801, 0, 5, "ゆかり", "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 0, "2030/12/31 15:00:00", "2023/07/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 682, 0, 0, 126901, 0, 126901, 7, 1, "ランファ（サマー）", 0, 0, 126901, 3, 126901, 0, 21, "らんふぁ", "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 0, "2025/08/31 11:59:59", "2025/08/22 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.97, 450, 133, 0, 0, 127001, 0, 127001, 2, 1, "クウカ（サマー）", 0, 0, 127001, 1, 127001, 0, 52, "くうか", "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 0, "2030/12/31 15:00:00", "2025/07/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 255, 0, 0, 127101, 0, 127101, 5, 1, "シノブ（サマー）", 0, 0, 127101, 3, 127101, 0, 46, "しのぶ", "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 0, "2025/08/31 11:59:59", "2025/08/22 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 804, 0, 0, 127201, 0, 127201, 7, 1, "キャル（編入生）", 0, 0, 127201, 3, 127201, 0, 7, "きゃる", "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 0, "2025/09/30 11:59:59", "2025/09/16 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 750, 0, 0, 127301, 0, 127301, 8, 0, "スズナ（編入生）", 0, 0, 127301, 3, 127301, 0, 8, "すずな", "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 0, "2030/12/31 15:00:00", "2023/09/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 127401, 0, 0, 1, 1, "ビカラ（コラボ）", 0, 0, 127401, 3, 0, 0, 1, "びから", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 304, 0, 0, 127501, 0, 127501, 4, 1, "サレン（サラサリア）", 0, 0, 127501, 3, 127501, 0, 4, "されん", "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 0, "2024/11/18 11:59:59", "2024/11/11 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 157, 0, 0, 127601, 0, 127601, 4, 0, "ルカ（サラサリア）", 0, 0, 127601, 3, 127601, 0, 4, "るか", "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 0, "2030/12/31 15:00:00", "2023/10/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 693, 0, 0, 127701, 0, 127701, 6, 0, "リンド", 0, 0, 127701, 3, 127701, 0, 48, "りんど", "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 0, "2030/12/31 15:00:00", "2024/10/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 706, 0, 0, 127801, 0, 127801, 7, 0, "ヴルム", 0, 0, 127801, 3, 127801, 0, 47, "うるむ", "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 0, "2030/12/31 15:00:00", "2024/10/18 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 372, 0, 0, 127901, 0, 127901, 5, 1, "ペコリーヌ（クリスマス）", 0, 0, 127901, 3, 127901, 0, 5, "ぺこりーぬ", "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 0, "2025/12/31 11:59:59", "2025/12/21 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 723, 0, 0, 128001, 0, 128001, 35, 0, "クレジッタ（クリスマス）", 0, 0, 128001, 3, 128001, 0, 35, "くれじった", "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 0, "2030/12/31 15:00:00", "2023/12/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 580, 181101, 0, 128101, 0, 0, 0, 1, "シズル（シズル&リノ）", 1, 0, 128101, 3, 0, 0, 0, "しずる", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 580, 181101, 0, 128201, 0, 0, 0, 1, "リノ（シズル&リノ）", 1, 0, 128201, 3, 0, 0, 0, "りの", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 191, 0, 0, 128301, 0, 128301, 3, 1, "イノリ（ニューイヤー）", 1, 0, 128301, 1, 128301, 0, 38, "いのり", "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 0, "2030/12/31 15:00:00", "2023/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 801, 0, 0, 128401, 0, 128401, 7, 1, "ハツネ（ニューイヤー）", 0, 0, 128401, 3, 128401, 0, 21, "はつね", "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 0, "2025/01/15 14:59:59", "2025/01/09 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 739, 0, 0, 128501, 0, 128501, 7, 1, "カスミ（ニューイヤー）", 0, 0, 128501, 3, 128501, 0, 21, "かすみ", "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 0, "2025/01/15 14:59:59", "2025/01/09 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 128601, 0, 0, 1, 1, "リリ（フォールン）", 0, 0, 128601, 3, 0, 0, 1, "りり", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 226, 0, 0, 128701, 0, 128701, 1, 1, "ヒヨリ（アストラル）", 0, 0, 128701, 3, 128701, 0, 0, "ひより", "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, "2025/02/15 14:59:59", "2025/02/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 194, 0, 0, 128801, 0, 128801, 4, 1, "レイ（アストラル）", 0, 0, 128801, 1, 128801, 0, 0, "れい", "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, "2030/12/31 15:00:00", "2025/08/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 772, 0, 0, 128901, 0, 128901, 7, 1, "ユイ（アストラル）", 0, 0, 128901, 3, 128901, 0, 0, "ゆい", "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, "2025/02/15 14:59:59", "2025/02/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 800, 0, 0, 129001, 0, 129001, 7, 1, "エリス", 0, 0, 129001, 3, 129001, 0, 0, "えりす", "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 708, 0, 0, 129301, 0, 129301, 7, 1, "ユニ（ウィンター）", 0, 0, 129301, 3, 129301, 0, 7, "ゆに", "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 0, "2025/03/15 14:59:59", "2025/03/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 188, 0, 0, 129401, 0, 129401, 2, 0, "クロエ（ウィンター）", 0, 0, 129401, 3, 129401, 0, 2, "くろえ", "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, "2030/12/31 15:00:00", "2024/03/18 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 247, 0, 0, 129501, 0, 129501, 1, 1, "チエル（ウィンター）", 0, 0, 129501, 3, 129501, 0, 1, "ちえる", "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 0, "2025/12/15 14:59:59", "2025/11/30 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 550, 0, 0, 129601, 0, 129601, 0, 1, "アネモネ", 0, 0, 129601, 3, 129601, 0, 0, "あねもね", "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 540, 0, 0, 129701, 0, 129701, 0, 1, "ネフィ＝ネラ", 0, 0, 129701, 3, 129701, 0, 0, "ねふぃーねら", "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 269, 0, 0, 129801, 0, 129801, 5, 1, "マコト（コマンダー）", 0, 0, 129801, 3, 129801, 0, 5, "まこと", "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 0, "2025/04/30 11:59:59", "2025/04/26 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 294, 0, 0, 129901, 0, 129901, 6, 0, "エリコ（コマンダー）", 0, 0, 129901, 3, 129901, 0, 48, "えりこ", "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, "2030/12/31 15:00:00", "2024/04/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 150, 0, 0, 130001, 0, 130001, 4, 1, "ヤマト", 0, 0, 130001, 3, 130001, 0, 0, "やまと", "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 535, 0, 0, 130101, 0, 130101, 7, 1, "ワカナ", 0, 0, 130101, 3, 130101, 0, 9, "わかな", "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 371, 0, 0, 130201, 0, 130201, 5, 1, "フブキ", 0, 0, 130201, 3, 130201, 0, 0, "ふぶき", "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 130601, 0, 0, 4, 1, "レイ（アストラル）", 0, 0, 130601, 3, 0, 0, 1, "れい", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 563, 0, 0, 130701, 0, 130701, 7, 1, "キョウカ（スプリング）", 0, 0, 130701, 3, 130701, 0, 7, "きょうか", "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 0, "2025/05/15 14:59:59", "2025/05/03 19:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 558, 0, 0, 130801, 0, 130801, 7, 0, "スズメ（スプリング）", 0, 0, 130801, 3, 130801, 0, 7, "すずめ", "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 0, "2030/12/31 15:00:00", "2024/05/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 440, 0, 0, 130901, 0, 130901, 7, 0, "クルル", 0, 0, 130901, 3, 130901, 0, 7, "くるる", "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 0, "2030/12/31 15:00:00", "2024/06/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 702, 0, 0, 131001, 0, 131001, 7, 1, "マホ（ドリームパーク）", 0, 0, 131001, 3, 131001, 0, 7, "まほ", "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 0, "2025/06/20 11:59:59", "2025/06/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 165, 0, 0, 131101, 0, 131101, 2, 0, "ネア（サマー）", 0, 0, 131101, 3, 131101, 0, 52, "ねあ", "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, "2030/12/31 15:00:00", "2024/06/30 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 753, 0, 0, 131201, 0, 131201, 54, 1, "ミソラ（サマー）", 0, 0, 131201, 3, 131201, 0, 54, "みそら", "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 0, "2025/07/23 11:59:59", "2025/07/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 131301, 0, 0, 1, 1, "リリ", 1, 0, 131301, 3, 0, 0, 1, "りり", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 131401, 0, 0, 1, 1, "クリア", 1, 0, 131401, 3, 0, 0, 1, "くりあ", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 131501, 0, 0, 1, 1, "プレシア", 1, 0, 131501, 3, 0, 0, 1, "ぷれしあ", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 399, 0, 0, 131601, 0, 131601, 4, 1, "リリ（サマー）", 0, 0, 131601, 3, 131601, 0, 4, "りり", "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 0, "2025/07/23 11:59:59", "2025/07/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 743, 0, 0, 131701, 0, 131701, 44, 1, "アメス（サマー）", 0, 0, 131701, 3, 131701, 0, 53, "あめす", "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 0, "2025/08/15 14:59:59", "2025/08/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 709, 0, 0, 131801, 0, 131801, 7, 0, "ホマレ（サマー）", 0, 0, 131801, 3, 131801, 0, 21, "ほまれ", "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 0, "2030/12/31 15:00:00", "2024/08/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 725, 0, 0, 131901, 0, 131901, 7, 1, "エミリア（サマー）", 1, 0, 131901, 1, 131901, 1, 23, "えみりあ", "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 0, "2030/12/31 15:00:00", "2024/08/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 775, 0, 0, 132001, 0, 132001, 7, 1, "エキドナ（サマー）", 0, 0, 132001, 3, 132001, 1, 21, "えきどな", "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 0, "2025/10/24 11:59:59", "2025/10/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 146, 0, 0, 132101, 0, 132101, 13, 1, "レム（サマー）", 0, 0, 132101, 3, 132101, 1, 24, "れむ", "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 0, "2025/10/24 11:59:59", "2025/10/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 721, 0, 0, 132201, 0, 132201, 7, 1, "ノゾミ（アルケミスト）", 0, 0, 132201, 3, 132201, 0, 7, "のぞみ", "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 0, "2025/10/31 11:59:59", "2025/10/24 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 754, 0, 0, 132301, 0, 132301, 7, 1, "ルイズマリー", 0, 0, 132301, 3, 132301, 0, 7, "るいずまりー", "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 0, "2025/12/15 14:59:59", "2025/11/30 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 501, 0, 0, 132401, 0, 132401, 5, 0, "イロハ", 0, 0, 132401, 3, 132401, 0, 0, "いろは", "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", 0, "2030/12/31 15:00:00", "2025/06/20 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 636, 0, 0, 132501, 0, 132501, 7, 0, "ソノ", 0, 0, 132501, 3, 132501, 0, 23, "その", "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", 0, "2030/12/31 15:00:00", "2025/05/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 750, 0, 0, 132801, 0, 132801, 7, 1, "ライラエル（クリスマス）", 0, 0, 132801, 3, 132801, 0, 0, "らいらえる", "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 0, "2025/12/15 14:59:59", "2025/11/30 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 748, 0, 0, 132901, 0, 132901, 5, 0, "イオ（クリスマス）", 0, 0, 132901, 3, 132901, 0, 46, "いお", "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 0, "2030/12/31 15:00:00", "2024/12/09 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 234, 0, 0, 133001, 0, 133001, 0, 1, "グレイス", 0, 0, 133001, 3, 133001, 0, 0, "ぐれいす", "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.75, 450, 154, 0, 0, 133101, 0, 133101, 0, 1, "ヴァイオレット", 0, 0, 133101, 3, 133101, 0, 0, "うぁいおれっと", "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 296, 0, 0, 133201, 0, 133201, 4, 1, "モニカ（ニューイヤー）", 1, 0, 133201, 1, 133201, 0, 22, "もにか", "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 0, "2030/12/31 15:00:00", "2024/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 718, 0, 0, 133501, 0, 133501, 4, 1, "サレン（ニューイヤー）", 0, 0, 133501, 3, 133501, 0, 22, "されん", "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 0, "2026/01/15 11:59:59", "2026/01/03 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 445, 0, 0, 133601, 0, 133601, 0, 1, "メドゥーサ", 0, 0, 133601, 3, 133601, 0, 0, "めどぅーさ", "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 0, "2026/01/15 11:59:59", "2026/01/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 717, 0, 0, 133701, 0, 133701, 8, 1, "ラビリスタ（アルファ）", 0, 0, 133701, 3, 133701, 0, 0, "らびりすた", "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 0, "2025/08/22 11:59:59", "2025/08/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 759, 0, 0, 133801, 0, 133801, 7, 1, "ネネカ（アルファ）", 0, 0, 133801, 3, 133801, 0, 0, "ねねか", "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 0, "2025/08/22 11:59:59", "2025/08/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 228, 0, 0, 133901, 0, 133901, 6, 1, "クリスティーナ（アルファ）", 0, 0, 133901, 3, 133901, 0, 0, "くりすてぃーな", "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 0, "2025/08/22 11:59:59", "2025/08/15 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 746, 0, 0, 134001, 0, 134001, 0, 1, "フィオ", 0, 0, 134001, 3, 134001, 0, 0, "ふぃお", "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 134101, 0, 0, 5, 1, "フブキ", 0, 0, 134101, 3, 0, 0, 1, "ふぶき", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 134201, 0, 0, 7, 1, "ライラエル（クリスマス）", 0, 0, 134201, 3, 0, 0, 1, "らいらえる", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 778, 0, 0, 134301, 0, 134301, 7, 1, "ランファ（儀装束）", 0, 0, 134301, 3, 134301, 0, 0, "らんふぁ", "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 0, "2025/09/30 11:59:59", "2025/09/16 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 773, 0, 0, 134401, 0, 134401, 7, 0, "チカ（儀装束）", 0, 0, 134401, 3, 134401, 0, 21, "ちか", "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 0, "2030/12/31 15:00:00", "2025/03/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 719, 0, 0, 134501, 0, 134501, 0, 1, "クローチェ（エアリアル）", 0, 0, 134501, 3, 134501, 0, 0, "くろーちぇ", "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 526, 0, 0, 134601, 0, 134601, 35, 1, "アオイ（パイロット）", 0, 0, 134601, 3, 134601, 0, 35, "あおい", "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 490, 0, 0, 134701, 0, 134701, 7, 1, "ホウオウ", 0, 0, 134701, 3, 134701, 0, 7, "ほうおう", "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 485, 0, 0, 134801, 0, 134801, 1, 1, "ツムギ（ジオ・ゲヘナ）", 0, 0, 134801, 3, 134801, 0, 1, "つむぎ", "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", 0, "2026/01/15 11:59:59", "2026/01/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 196, 0, 0, 134901, 0, 134901, 2, 1, "カノン", 0, 0, 134901, 3, 134901, 0, 0, "かのん", "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", 0, "2026/01/15 11:59:59", "2026/01/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 785, 0, 0, 135001, 0, 135001, 7, 1, "エリス（サマー）", 0, 0, 135001, 3, 135001, 0, 21, "えりす", "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", 0, "2025/07/10 11:59:59", "2025/06/30 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 143, 0, 0, 135101, 0, 135101, 4, 1, "シェフィ（サマー）", 0, 0, 135101, 3, 135101, 0, 4, "しぇふぃ", "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", 0, "2025/07/23 11:59:59", "2025/07/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 548, 0, 0, 135201, 0, 135201, 7, 1, "プレシア（サマー）", 0, 0, 135201, 3, 135201, 0, 7, "ぷれしあ", "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", 0, "2025/07/31 11:59:59", "2025/07/23 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 413, 0, 0, 135301, 0, 135301, 54, 1, "クリア（サマー）", 0, 0, 135301, 3, 135301, 0, 54, "くりあ", "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", 0, "2025/08/10 11:59:59", "2025/07/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 553, 0, 0, 135401, 0, 135401, 2, 1, "アネモネ（サマー）", 0, 0, 135401, 3, 135401, 0, 52, "あねもね", "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", 0, "2025/08/15 14:59:59", "2025/08/10 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 213, 0, 0, 135501, 0, 135501, 1, 1, "アイラ", 0, 0, 135501, 3, 135501, 0, 0, "あいら", "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.4, 450, 198, 0, 0, 135601, 0, 135601, 4, 1, "シナツ", 0, 0, 135601, 3, 135601, 0, 0, "しなつ", "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 291, 0, 0, 135701, 0, 135701, 1, 0, "ヒヨリ（サラサリア）", 0, 0, 135701, 3, 135701, 0, 0, "ひより", "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", 0, "2030/12/31 15:00:00", "2025/09/16 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 830, 0, 0, 135801, 0, 135801, 7, 1, "ユキノ", 0, 0, 135801, 3, 135801, 0, 0, "ゆきの", "【魔法】後衛から、雪魄氷姿の三味を弾じる初心な雪女。\n多様なデバフ効果で敵を弱体化させ、最も魔防の低い敵の\n状態に応じて発生する追加効果で、冥府を真白に染める。", 0, "2025/10/10 11:59:59", "2025/09/30 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 219, 0, 0, 135901, 0, 135901, 3, 1, "サツキ", 0, 0, 135901, 3, 135901, 0, 0, "さつき", "【物理】前衛で、華奢な体躯に厚い仁義を宿す鬼のお嬢。\n攻防自己強化や行動不能無効化で豪胆に立ち続け、自分が\n呪詛状態の時に振るう追加攻撃で、怪力無双の力を示す。", 0, "2025/10/24 11:59:59", "2025/10/10 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 732, 0, 0, 136001, 0, 136001, 11, 1, "アラクネ", 0, 0, 136001, 3, 136001, 0, 0, "あらくね", "【物理】後衛で、喪われた光を求めてもがく元『六凶』。\n敵のＵＢを遅延する【遮絶の操糸】や、味方単体のＵＢを\n連続発動可能にする【賦活の糸】を戦場に張り巡らせる。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.74, 450, 432, 0, 0, 136101, 0, 136101, 0, 1, "サクラ", 0, 0, 136101, 3, 136101, 1, 0, "さくら", "【物理】中衛で不運に抗い歌い続けるゾンビィアイドル。\n一度倒れても立ち上がり、ＴＰを糧に強化されるスキルの\nダメージと味方の支援で、サガの心をアストルムに刻む。", 0, "2025/11/03 11:59:59", "2025/10/24 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 198, 0, 0, 136201, 0, 136201, 3, 0, "ナーナ", 0, 0, 136201, 3, 136201, 0, 3, "なーな", "【物理】前衛でダメダメでも逃げず戦うアルミラージ娘。\n最も近くの味方に強化や行動不能無効の付与、回復を行い\n敵の注意をそらすことで、過酷な世界を生き延びる。", 0, "2030/12/31 15:00:00", "2025/11/14 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 655, 0, 0, 136301, 0, 136301, 35, 1, "ミソラ（クリスマス）", 0, 0, 136301, 3, 136301, 0, 54, "みそら", "【魔法】後衛で、シゲキ的な聖夜に鼓動高鳴る溌溂少女★\n【イルミネーションバレット】を消費して味方を支援し、\n40消費後は追加の範囲攻撃やバフでキュン★を届ける。", 0, "2025/12/21 11:59:59", "2025/12/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.84, 450, 382, 0, 0, 136401, 0, 136401, 7, 1, "ユイ（クリスマス）", 0, 0, 136401, 3, 136401, 0, 21, "ゆい", "【魔法】中衛で、騎士の隣に一歩踏み出す聖夜の魔法士。\n敵の注目を集めながら攻防支援を行い【聖夜の愛慕】が\n高まると、ＴＰ支援やダメージカットで優しく包み込む。", 0, "2025/12/15 14:59:59", "2025/11/30 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 151, 0, 0, 136501, 0, 136501, 5, 1, "シズル（ニューイヤー）", 0, 0, 136501, 3, 136501, 0, 0, "しずる", "【物理】前衛で、凛然と立ちはだかる新年のお姉ちゃん。\n挑発と行動不能無効で攻撃を鮮やかに捌き、状況に応じて\n物理・魔法を自在に操り、弟くんへの愛を見せつける。", 0, "2026/01/15 11:59:59", "2026/01/03 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 136601, 0, 0, 1, 0, "メドゥーサ", 0, 0, 136601, 1, 0, 0, 1, "めどぅーさ", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
