INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 136801, 0, 0, 7, 1, "ランファ（儀装束）", 0, 0, 136801, 3, 0, 0, 1, "らんふぁ", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 566, 0, 0, 137101, 0, 137101, 8, 0, "ニノン（サマー）", 0, 0, 137101, 3, 137101, 0, 47, "にのん", "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 0, "2030/12/31 15:00:00", "2025/08/15 15:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 137201, 0, 0, 2, 0, "ラビリスタ", 0, 0, 137201, 3, 0, 0, 2, "らびりすた", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 137301, 0, 0, 2, 1, "カノン", 0, 0, 137301, 3, 0, 0, 1, "かのん", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 688, 0, 0, 137401, 0, 137401, 7, 1, "カスミ（シスター）", 0, 0, 137401, 3, 137401, 0, 21, "かすみ", "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", 0, "2025/11/14 14:59:59", "2025/11/03 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 137501, 0, 0, 1, 1, "アイラ", 0, 0, 137501, 3, 0, 0, 1, "あいら", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 733, 0, 0, 137601, 0, 137601, 7, 1, "コッコロ（嚮導幼君）", 0, 0, 137601, 3, 137601, 0, 0, "こっころ", "【魔法】後衛で、主さまを想い“進化”した嚮導の巫女。\n極大ダメージのＵＢで敵を穿ち、【進化超越】の権能によ\nって、味方のバフやダメージを、限界を超え成長させる。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 137801, 0, 0, 7, 1, "ユキノ", 0, 0, 137801, 3, 0, 0, 1, "ゆきの", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
