INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 138601, 0, 0, 1, 1, "サクラ", 0, 0, 138601, 3, 0, 0, 1, "さくら", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 141401, 0, 0, 1, 0, "シズル（ニューイヤー）", 0, 0, 141401, 1, 0, 0, 1, "しずる", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 245, 0, 4, 170101, 0, 170101, 34, 0, "ジータ", 0, 0, 170101, 3, 105701, 0, 34, "じーた", "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.62, 450, 199, 0, 7, 180101, 0, 180101, 0, 1, "ヒヨリ（プリンセス）", 0, 0, 180101, 3, 180101, 0, 0, "ひより", "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 767, 0, 1, 180201, 0, 180201, 0, 1, "ユイ（プリンセス）", 0, 0, 180201, 3, 180201, 0, 0, "ゆい", "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 377, 0, 7, 180301, 0, 180301, 0, 1, "レイ（プリンセス）", 0, 0, 180301, 3, 180301, 0, 0, "れい", "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.965, 450, 155, 0, 1, 180401, 0, 180401, 0, 1, "ペコリーヌ（プリンセス）", 0, 0, 180401, 3, 180401, 0, 0, "ぺこりーぬ", "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.14, 450, 555, 0, 1, 180501, 0, 180501, 0, 1, "コッコロ（プリンセス）", 0, 0, 180501, 3, 180501, 0, 0, "こっころ", "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 747, 0, 1, 180601, 0, 180601, 0, 1, "キャル（プリンセス）", 0, 0, 180601, 3, 180601, 0, 0, "きゃる", "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.75, 450, 732, 0, 1, 180701, 0, 180701, 0, 1, "ハツネ＆シオリ", 0, 0, 180701, 3, 180701, 0, 0, "はつねしおり", "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.5, 450, 465, 0, 1, 180801, 0, 180801, 0, 1, "ミソギ＆ミミ＆キョウカ", 0, 0, 180801, 3, 180801, 0, 0, "みそぎみみきょうか", "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 421, 0, 1, 180901, 0, 180901, 0, 1, "アキノ＆サレン", 0, 0, 180901, 3, 180901, 0, 0, "あきのされん", "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.09, 450, 577, 0, 1, 181001, 0, 181001, 0, 1, "アン＆グレア", 0, 0, 181001, 3, 181001, 0, 0, "あんぐれあ", "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 2, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 551, 0, 1, 181101, 0, 181101, 0, 1, "シズル＆リノ", 0, 0, 181101, 3, 181101, 0, 0, "しずるりの", "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (1.92, 450, 368, 0, 1, 181201, 0, 181201, 0, 1, "シェフィ（プリンセス）", 0, 0, 181201, 3, 181201, 0, 0, "しぇふぃ", "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", 0, "2026/01/03 11:59:59", "2025/12/31 12:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 190801, 0, 0, 1, 0, "カリン", 0, 0, 190801, 1, 0, 0, 1, "かりん", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 191201, 0, 0, 1, 0, "ペテルギウス", 0, 0, 191201, 1, 0, 0, 1, "ぺてるぎうす", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (2.22, 450, 850, 0, 0, 191301, 0, 191301, 6, 1, "カズマサ", 0, 0, 191301, 1, 191301, 0, 6, "かずまさ", "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 1, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 0, 0, 0, 0, 191401, 0, 0, 6, 0, "コッコロ", 0, 0, 191401, 0, 0, 0, 6, "こっころ", "", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
INSERT INTO `v1_971ef39611c1869321cf9f48c9344fd1783d1405487d2ae2736354ed4cd69c7c` VALUES (0.0, 150, 1600, 0, 0, 191501, 0, 100101, 0, 0, "主人公", 0, 0, 191501, 0, 100101, 0, 0, "しゅじんこう", "残されたわずかな時間で宿題を終わらせんとする\nルーセント学院の生徒。楽しい夏休みの思い出を\n守るため、山積みの宿題へと立ち向かう。", 0, "2030/12/31 15:00:00", "2015/04/01 15:00:00", 0, 0);
